import { HeartOutlined } from "@ant-design/icons";
import { Card, Rate } from "antd";


const Comment = () => {
    return(
        <div>
             <Card
      size="small"
      title="Small size card"
      extra={<a href="#">More</a>}
      style={{
        width: 300,
      }}
    >
      <p>Card content</p>
      <p>Card content</p>
      <p>Card content</p>
    </Card>
        </div>
    );
};

export default Comment;
